CREATE TABLE IF NOT EXISTS "users_perfil" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "debaja" bool NOT NULL, "grupo_id" integer NOT NULL REFERENCES "users_grupo" ("id"), "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id"));
CREATE TABLE IF NOT EXISTS "users_grupo_permisos" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "grupo_id" integer NOT NULL REFERENCES "users_grupo" ("id"), "permiso_id" integer NOT NULL REFERENCES "users_permiso" ("id"));
CREATE TABLE IF NOT EXISTS "users_grupo_usuarios" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "grupo_id" integer NOT NULL REFERENCES "users_grupo" ("id"), "user_id" integer NOT NULL REFERENCES "auth_user" ("id"));
CREATE TABLE IF NOT EXISTS "Locaciones_localidades" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(100) NOT NULL, "cp" varchar(10) NULL, "provincia_id" integer NOT NULL REFERENCES "Locaciones_provincias" ("id"), "debaja" bool NOT NULL, "latitud" real NOT NULL, "longitud" real NOT NULL);
