CREATE TABLE IF NOT EXISTS "Locaciones_provincias" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(30) NOT NULL UNIQUE, "debaja" bool NOT NULL, "latitud" real NOT NULL, "longitud" real NOT NULL);
